const defalutKeysForFolder = ["name", "metadata", "type", "links"];

export const generateRoutes = (data = {}) => {
  const keys = Object.keys(data);
  const filterFolders = keys.filter((el) => {
    return !defalutKeysForFolder.includes(el);
  });

  if (filterFolders.length === 0) {
    return {
      name: data.name,
      metadata: data.metadata,
      type: data.type,
      links: data.links,
      children: filterFolders,
    };
  } else {
    return {
      name: data.name ? data.name : "Root",
      metadata: data.metadata ? data.metadata : [],
      type: data.type ? data.type : "folder",
      links: data.links ? data.links : [],
      children: filterFolders.map((el) => {
        return generateRoutes(data[el]);
      }),
    };
  }
};
